import React from "react";

export default function Start() {
  return (
    <div className="h-screen bg-blue-500 text-white tracking-wider">
      <div className="flex flex-col items-center justify-center space-y-8 pt-8">
        <h1 className="text-4xl">
          Hi, I'm <span className="font-semibold">Wajahat</span>!
        </h1>
        <p className="w-2/3 text-center text-xl">
          I develop websites using modern technology. My stack is{" "}
          <span className="uppercase">mern</span> Mongo, Express, React, Node.js
        </p>
      </div>
    </div>
  );
}
